  Jason Giuliano ... Endercott 
  Alec Rayme ... Cop at Intersection 
  Lawrence Turner ... Retirement Home Assassin 
  Emily Kuroda ... Mrs. Chan 
  Joe Chrest ... Retirement Home Detective 
